import React, { Component } from 'react';
import Recipe from './Recipe';
import ReactSearch from './RecipeSearch';

export default class RecipeList extends Component {
  render() {
    return (
      <React.Fragment>
        <Recipe />
        <ReactSearch />
      </React.Fragment>
    )
  }
}
